import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  navbarText: {
    width: 69,
    height: 28,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "500",
    fontSize: 24,
    lineHeight: 28,
  },
});
